var tipuesearch = {"pages":[{"url":"./pages/about/","title":"About","tags":"misc","text":"2017Spring 機械設計工程系網際內容管理 課程倉儲: http://github.com/mdecourse/2017springwcm 課程投影片: http://mdecourse.github.io/2017springwcm 課程網誌: http://mdecourse.github.io/2017springwcm/blog"},{"url":"./2017wang-ji-nei-rong-guan-li-qi-mo-xin-de.html","title":"2017網際內容管理期末心得","tags":"Misc","text":"快點進來看看唄！ 大一下學期，期中考後學到了很多不一樣的東西。 首先老師先叫我們將不要用的主機的RAM、硬碟拆下，裝入另一台要留下來主機裡。 之後因為我們先將主機的保護卡拔除，並把電池拔下又裝上，整個主機就會被重設，然後需要使用光碟重灌才能開機。 老師拿出光碟後，開始示範放入光碟後要點甚麼選項，真的很多選項要選，選項當中會要你設定Username以及password，2個都只要打wcmg5就好。當全部選項都搞定之後，主機會要求你重開機，並自動退出光碟。當電腦再次開機，只要輸入剛剛設定的Username以及password，電腦就完成開機了。 以上就是我這學期學到內容之一。"},{"url":"./2017wang-ji-nei-rong-guan-li-zhi-xu-ni-zhu-ji.html","title":"2017網際內容管理之虛擬主機","tags":"Misc","text":"虛擬主機使用方式!!! 其實只是心得文而已 老師向我們示範這一套虛擬主機軟體 透過虛擬主機 我們也可以進行網頁Blog製作 我是第一次接觸這種虛擬主機 老實說我完全沒有任何頭緒 所以在此沒辦法說出學到任何東西 只覺得非常複雜 就是這樣的一篇心得文 謝謝老師的教導 我之後也還是會認真聽講 也會試著自己操作上課所學到的東西 祝老師身體健康 祝我能夠及格!!!!"},{"url":"./2017wang-ji-nei-rong-guan-li-zhi-wang-lu-xian-zhi-zuo.html","title":"2017網際內容管理之網路線製作","tags":"Misc","text":"學習自己製作網路線、跳線 做這個好像非常賺錢 我們要製作一般網路線 以及 跳線 先將網路線兩端的前端塑膠皮剝除 再套入網路線接頭 兩端都要套入正確方向 之後將露出來的網路線轉開 成一條一條的狀態 而一般網路線的排列順序為: 設線兩端分別為A端及B端 ． A端 白橙 - 橙 - 白綠 - 藍 - 白藍 - 綠 - 白棕 - 棕 ． B端 白橙 - 橙 - 白綠 - 藍 - 白藍 - 綠 - 白棕 - 棕 排列好後 把每條線剪平並注意 塑膠皮要塞進網路線接頭 所以不能去除太多 剛好可以讓接頭咬住塑膠皮即可 接頭內有8個軌道供網路線插入 將內線排好 一起塞入接頭 要注意一個軌道只能一條內線進入 並且順序要對 確認有內線有插到底 順序沒有錯誤 就可拿出壓線鉗 上方有一個剛好吻合網路線接頭的洞 塞進去聽到 喀!一聲 代表接頭有卡住 壓緊壓線鉗 直到壓線鉗自己鬆開 這樣就完成一條網路線!!! 而跳線的排列順序為: 設線兩端分別為A端及B端 ． A端 白橙 - 橙 - 白綠 - 藍 - 白藍 - 綠 - 白棕 - 棕 ． B端 白綠 - 綠 - 白橙 - 藍 - 白藍 - 橙 - 白棕 - 棕"}]};